import React from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';
import StyleConfidentialityCenter from "./StyleConfidentialytiCenter";

const Confidentialitycenter = ()=>{
    return <View style ={StyleConfidentialityCenter.centerConteiner}>
       <Text>User</Text>
       <View>   
            <TouchableOpacity style ={StyleConfidentialityCenter.centerButtons}><Text style ={StyleConfidentialityCenter.buttonText}>Blocked User</Text></TouchableOpacity>
            <TouchableOpacity ><Text style ={StyleConfidentialityCenter.buttonText}>Blocked User</Text></TouchableOpacity>
       </View>
    </View>
}

export default Confidentialitycenter;
